import React from 'react';

const VietSilk = () => {
  return (
    <div className="container">
      <header className="header">
        <div className="logo">
          <h1 className="logo-title">VietSilk</h1>
        </div>
        <nav className="navigation">
          <ul className="nav-list">
            <li className="nav-item">Women</li>
            <li className="nav-item">Men</li>
            <li className="nav-item">Kids</li>
          </ul>
        </nav>
      </header>

      <section className="hero">
        <h2 className="hero-title">End-of-Season Sale</h2>
        <p className="hero-subtitle">Further Reductions. Save on selected items.</p>
        <div className="hero-buttons">
          <button className="button">Shop Women's Sale</button>
          <button className="button">Shop Men's Sale</button>
        </div>
      </section>

      {/* Các phần khác sẽ thêm tiếp */}
    </div>
  );
};

export default VietSilk;
